class Stack:
    def __init__(self):
        self.stack = []

    def copy(self, new_stack):
        self.stack = new_stack.stack.copy()

    def push(self, value):
        self.stack.append(value)

    def pop(self):
        return self.stack.pop()

    def count_different_numbers(self, other):
        count = 0
        for num in set(self.stack):
            if num not in other.stack:
                count += 1
        return count

